import React from "react";

function App() {
  return (
    <React.Fragment>
      <div>Hello world</div>
      <a href="#">click me</a>
      <button>click me too</button>
      <ul>
        <li>1</li>
        <li>2</li>
        <li>2</li>
      </ul>
    </React.Fragment>
  );
}

export default App;
